import React from "react";

const projects = [
  { title: "Aplikasi Inventory", description: "Aplikasi berbasis Flutter dengan pemindai barcode yang membantu manajemen stok barang dengan efisien.", link: "#" },
  { title: "HomeTasker", description: "Platform untuk penyedia jasa rumah tangga seperti bersih-bersih, reparasi, dan lainnya.", link: "#" },
  { title: "OpenMusic API", description: "Backend API dengan fitur manajemen playlist kolaboratif yang dapat digunakan oleh banyak pengguna.", link: "#" },
  { title: "Wedding Organizer", description: "Website untuk manajemen acara pernikahan dengan fitur pemesanan vendor dan jadwal acara.", link: "#" },
  { title: "Pariwisata Digital", description: "Aplikasi Java Spring Boot untuk informasi wisata, rekomendasi tempat, dan ulasan pengunjung.", link: "#" },
  { title: "E-Learning Platform", description: "Platform pembelajaran online dengan fitur ujian interaktif dan materi edukasi.", link: "#" }
];

const Projects = () => {
  return (
    <section id="projects" style={{ padding: "50px", textAlign: "center" }}>
      <h2>Proyek</h2>
      <div 
        style={{ 
          overflowX: "scroll", 
          whiteSpace: "nowrap", 
          padding: "20px", 
          scrollbarWidth: "none", 
          msOverflowStyle: "none" 
        }}
      >
        <div 
          style={{ 
            display: "flex", 
            gap: "20px"
          }}
        >
          {projects.map((project, index) => (
            <div 
              key={index} 
              style={{
                minWidth: "220px", 
                maxWidth: "250px", 
                height: "250px", // Menjaga tinggi kartu agar seragam
                padding: "15px", 
                border: "1px solid #ddd",
                borderRadius: "10px",
                textAlign: "left",
                background: "#f9f9f9",
                boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
                display: "flex",
                flexDirection: "column",
                justifyContent: "space-between"
              }}
            >
              <h3 style={{ fontSize: "16px", marginBottom: "5px" }}>{project.title}</h3>
              <p 
                style={{
                  overflow: "hidden",
                  display: "-webkit-box",
                  WebkitBoxOrient: "vertical",
                  WebkitLineClamp: 3, // Tampilkan 3 baris sebelum "..."
                  textOverflow: "ellipsis",
                  fontSize: "14px",
                  flexGrow: 1
                }}
              >
                {project.description}
              </p>
              <a href={project.link} target="_blank" rel="noopener noreferrer" style={{ fontSize: "14px", color: "blue", textDecoration: "none", marginTop: "auto" }}>
                Lihat Proyek
              </a>
            </div>
          ))}
        </div>
      </div>
      <style>
        {`
          #projects div::-webkit-scrollbar {
            display: none;
          }
        `}
      </style>
    </section>
  );
};

export default Projects;
